import { Link } from "react-router-dom";
import './options.css';

const Options = () => {
    return(
        <div className='options'>
            <div className='selector'>
                <ul className="select-items">
                    <li className="select-item">
                        <a className="size-options">(Par défaut) 3x3</a>
                    </li>
                </ul>
            </div>
            <div className='start'>
                <button className='gameStart'><Link to="/game"> Démarrer la partie</Link></button>
            </div>
        </div>
    )
}


export default Options;
